// External imports
import React from 'react';

// Internal imports
import Page from '../../components/nav/Page';


function VeilingMeesterDashboard() {
	return (
		<Page enableHeader enableFooter className="dashboard-page">
			<main className = "kweker-container">
			<section className="kweker-hallo">
					<h1>Hallo, kweker!</h1>
					<p className="kweker-desc">Welkom op de dashboard pagina! Bekijk hier uw producten!</p>
				</section>
			</main>
			
			
			
		</Page>
	);
}

export default VeilingMeesterDashboard;
